import './App.css';
import Statusbar from './Components/Status-bar';
import Background from './assets/img/mac-os-background';

var background = {
  width: '100%',
  height: '100%',
  backgroundImage: 'url(' + { Background } + ')',
};

function App() {
  return (
    <div className="App">
      <Statusbar />
      <div className="container" style={background}></div>
    </div>
  );
}

export default App;
